export class Dto {

    constructor(public total: number,
        //public result: Map<number, number>,
       // public previousResult: Map<number, number>,
       // public difference: Map<number, string>
       public result: string,
       public previousResult: string,
       public difference: string
       ) {

        }

        public toString(): string {
            console.log("total is : " + this.total);
            console.log("result is : " + this.result);
            console.log("previousResult is : " + this.previousResult);
            console.log("difference is : " + this.difference);
            return "";
        }
}
